    false,nt"url": null,nt"notes": "The Oregon Department of Geology & Mineral
    Industries (DOGAMI) contracted with Watershed Sciences, Inc. to collect high resolution
    topographic LiDAR data for multiple areas within the State of Oregon. The areas
    for LiDAR collection have been designed as part of a collaborative effort of state,
    federal, and local agencies in order to meet a wide range of project goals. This
    LiDAR data set was collected from May 19 - 20, 2011 and encompasses portions of
    Jefferson, Wasco, and Wheeler counties in Oregon. This data set consists of bare
    earth and unclassified points. The average pulse density is 8.89 pulses per square
    meter over terrestrial surfaces. The area of interest (AOI) encompasses 160 square
    miles (102,447 acres) and the total area flown (TAF) covers 163 square miles (104,631
    acres). The TAF acreage is greater than the original AOI acreage due to buffering
    and flight planning optimization. In some areas of heavy vegetation or forest cover,
    there may be relatively few ground points in the LiDAR data. Elevation values for
    open water surfaces are not valid elevation values because few LiDAR points are
    returned from water surfaces. LiDAR intensity values were also collected.",nt"license_title":
